import React, {useState, useEffect } from 'react'
import Practice from './Practice'

const All = () => {

        const[city, setCity] =  useState(null);
        const[search, setSearch] = useState('pune');


        useEffect(() =>{ 
            const fun = async () => {
                const url =`http://api.openweathermap.org/data/2.5/weather?q=${search}&units=metric&appid=1ef216418fb0b17ea1a8acc2951a37c8`;
                const fetchUrl = await fetch(url);
                const resJson = await fetchUrl.json();
                setCity(resJson.main);
            }
        
        },[search])



    return (
        <>
            <Practice city={city} search={search} setSearch={setSearch} />
        </>
    )
}

export default All
